<script type="text/javascript">


$(document).ready(function() {

// Init some variables

//console.log('-> start');

var svg = d3.select("#map");
var regions = d3.selectAll("g#layer-regions path");		
var mapdata = <?= $jsonregions ?>;
var mapresource = <?= $jsonresources ?>;
var mapdiplo = <?= $jsondiplomacy ?>;
var charkingdomid = <?= $character -> region -> kingdom -> id ?>;
var charpositionid = <?= $current_position -> id ?>;
var selectedregion = 0;

var width = 1200,
	height = 800,
	center = [width / 2, height / 2];

var zoom = d3.behavior.zoom()
	.scaleExtent([1, 8])
	.on("zoom", zoomed);
	
svg
	.call(zoom)
	.call(zoom.event);	

initGUI();

d3.select('#disableregion').on('click', function() {	
	$.ajax({
	url: '<?php echo url::base(true)?>' + '/jqcallback/disableregion',
	type: 'POST',
	data: { region_id: d3.select(selectedregion).attr('id')},
	success: function(data) 
	{			
		console.log('region:' + data)
		if (data=='disabled')
			d3.select(selectedregion).style("fill", "#333");
		else
			d3.select(selectedregion).style("fill", "#ffd");
	}
	});
});


/* Move */

var curx = 0;
var cury = 0;	
var movefactor = 32;

d3.select('#north').on('click', function()
{
		//console.log('hit north: ' + zoom.translate);
		curx = zoom.translate()[0];
		cury = zoom.translate()[1] + movefactor;
		zoom.translate([curx,cury]);			
		zoomed();			
});


d3.select('#south')
.on('click', function()
{
		curx = zoom.translate()[0];
		cury = zoom.translate()[1] - movefactor;			
		zoom.translate([curx,cury]);			
		zoomed();
});

d3.select('#east')
.on('click', function()
{
		curx = zoom.translate()[0]+movefactor;
		cury = zoom.translate()[1];
		zoom.translate([curx,cury]);			
		zoomed();
});


d3.select('#west')
.on('click', function()
{
		curx = zoom.translate()[0]-movefactor;
		cury = zoom.translate()[1];			
		zoom.translate([curx,cury]);			
		zoomed();
});

/* Reset */

d3.select("#reset")
	.on("click", reset );

function reset() {
	d3.transition().duration(350).tween("zoom", function () {
		zoom.translate([0,0]).scale(1);    
		zoomed();
	});
	paint('kingdoms', 'all');
}

/* Info */

d3.selectAll("path")
.on('click', function()
{				
	console.log("PATH");
	d3.select(".pathselected").classed("pathselected", false);
  d3.select(this).classed("pathselected", true);	
	d3.select('#map-infopanel').html(buildtooltip(d3.select(this).attr('id')));	
	selectedregion = this;
});

/** Paint **/

d3.select('#showclima')
.on('click', function()
{		
	//console.log('Show Clima...');
	paint('clima', 'all');
});

d3.select('#showgeography')
.on('click', function()
{		
	//console.log('Show Geo...');
	paint('geography', 'all');
});

d3.select('#showkingdom')
.on('change', function()
{		
	if ($(this).val() == 'all')
		paint('kingdoms', 'all');	
	else	
		paint('kingdoms', $(this).val());
});

d3.select('#showresources')
.on('click', function()
{			
	paint('resources', $(this).val());
});

d3.select('#showdiplomacy')
.on('click', function()
{		
	//console.log('Show Diplomacy...');
	paint('diplomacy', $(this).val());
});

// Where am i?

d3.select('#whereami').on("click", 
	function()
	{
		regions.each(function(d, i) {
			
			if( mapdata[d3.select(this).attr('id')] && d3.select(this).attr('id') == charpositionid )
				d3.select(this)
				.style("fill", "url(#diagonal-stripe-5)")
				.attr("x", 0)
				.attr("y", 0)
				.attr("height", 150)
				.attr("width", 150);							
			
		})			
	}
);
	
// Zoom


function zoomed() {
	regions.attr("transform",
			"translate(" + zoom.translate() + ")" +
			"scale(" + zoom.scale() + ")"
	);
}
	
d3.selectAll('.zoombutton').on('click', function(){
	d3.event.preventDefault();
	var scale = zoom.scale(),
			extent = zoom.scaleExtent(),
			translate = zoom.translate(),
			x = translate[0], y = translate[1],
			factor = (this.id === 'zoomin') ? 1.2 : 1/1.2,
			target_scale = scale * factor;
	// If we're already at an extent, done
	
	if (target_scale < extent[0] || target_scale > extent[1]) { return false; }
	// If the factor is too much, scale it down to reach the extent exactly
	var clamped_target_scale = Math.max(extent[0], Math.min(extent[1], target_scale));
	if (clamped_target_scale != target_scale){
			target_scale = clamped_target_scale;
			factor = target_scale / scale;
	}
	// Center each vector, stretch, then put back
	x = (x - center[0]) * factor + center[0];
	y = (y - center[1]) * factor + center[1];
	// Transition to the new view over 350ms
	d3.transition().duration(350).tween("zoom", function () {
			var interpolate_scale = d3.interpolate(scale, target_scale),
					interpolate_trans = d3.interpolate(translate, [x,y]);
			return function (t) {
					zoom.scale(interpolate_scale(t))
							.translate(interpolate_trans(t));
					zoomed();
			};
	});
});

function buildtooltip( region_id )
{
	var content = "";
	
	if (mapdata[region_id].status == 'disabled')
	{
		content = content + "<div><div style='float:left;margin-right:5px'><img src='" + '<?php echo url::base(false);?>' + "media/images/heraldry/" + mapdata[region_id].kingdom_image + "-large.png'></div>";	
		content = content + "<div style='float:left'><strong>";	
		content = content + mapdata[region_id].name+ "</strong>" + "<br/>" + mapdata[region_id].kingdom_name + "<br/>";	
		content = content + "ID: " + region_id + "<br/>";
		content = content + "</div>";
		content = content + "<hr style='clear:both'/></div>";
		content = content + "<div style='float:left'><strong>";	
		content = content + mapdata[region_id].geographytext;
		content = content + "<br/>" + mapdata[region_id].climatext;					
	}
	else
	{
		content = content + "<div><div style='float:left;margin-right:5px'><img src='" + '<?php echo url::base(false);?>' + "media/images/heraldry/" + mapdata[region_id].kingdom_image + "-large.png'></div>";	
		content = content + "<div style='float:left'><strong>";	
		content = content + mapdata[region_id].name+ "</strong>" + "<br/>" + mapdata[region_id].kingdom_name + "<br/>";	
		if (mapdata[region_id].capital == true)
			content = content + "<?=kohana::lang('global.capital');?><br/>";
		content = content + "ID: " + region_id + "<br/>";

		content = content + "</div>";
		content = content + "<hr style='clear:both'/></div>";
	
		// comandi
		
		content = content + mapdata[region_id].infolink + " | " +
			mapdata[region_id].lawslink;
			
		if (mapdata[region_id].hasOwnProperty('travelinfo'))
		{
			content = content + " | ";
			if ( mapdata[region_id].travelinfo.linktravel == true )
				content = content + mapdata[region_id].travelinfo.linktravelaction; 
		}	
		
		content = content + '<br/>';
		content = content + mapdata[region_id].geographytext;
		content = content + "<br/>" + mapdata[region_id].climatext;					
		
		
		
		if (mapdata[region_id].hasOwnProperty('travelinfo'))
		{
		
			content = content + "<br/>" + mapdata[region_id].travelinfo.realtraveltimetext;
			content = content + "<br/>" + mapdata[region_id].travelinfo.costtext;
			content = content + "<br/>" + mapdata[region_id].travelinfo.energytext;
			content = content + "<br/>" + mapdata[region_id].travelinfo.gluttext;						
		}
		
		// risorse
		//console.log(mapdata[region_id]);
		content = content + "<br/>" + "<?= kohana::lang("global.resource")?>: ";
		if ( mapdata[region_id].hasOwnProperty('resources') )
		{
			//console.log(mapdata[region_id].resources);
			$.each(mapdata[region_id].resources.info, function (key, value)
			{				
				content = content + "<span class='value'>" + value.name + "</span>";
				if ( mapdata[region_id].canseeavailability == true )
					content = content + ' ' + value.availability;
				content += " ";			
			})
		}
			//if ( mapdata[region_id].canseeresources == true )
				//content = content + "<br/>" + mapdata[region_id].resources.info;
	}
	
	return content;
}

function initGUI()
{
		// hide text map
		$("#text-map").hide();
		
		d3.select('#map-infopanel').html(buildtooltip(charpositionid));	
		
		//color all kingdoms
		
		paint('kingdoms', 'all');	
		
}

/*
*	Paint regions
*/

function paint(what, part)
{
	//console.log('-> Called paint: ' + what + ', ' + part );

switch (what)
{
	
	case 'kingdoms':
		
		if (part == 'all')
		{				
			
			regions.each( function( d ,i )
			{									
					
					if( mapdata[d3.select(this).attr('id')] )											
					{			
						//color map only if region is land.
						if ( mapdata[d3.select(this).attr('id')].geography != 'water' )
						{
							
							if (mapdata[d3.select(this).attr('id')].status == 'disabled' )
							{								
								d3.select(this).style("fill", "#333");
							}
							else							
								d3.select(this)
								.style("fill", mapdata[d3.select(this).attr('id')].kingdom_color );
						}
						// strike blu if region is a capital
						if ( mapdata[d3.select(this).attr('id')].capital == true )
							 d3.select(this).classed("capital", true);	
							
						// color only whereami
						
						if( mapdata[d3.select(this).attr('id')] && d3.select(this).attr('id') == charpositionid )
							d3.select(this)
							.style("fill", "url(#diagonal-stripe-5)")
							.attr("x", 0)
							.attr("y", 0)
							.attr("height", 150)
							.attr("width", 150);
					}
				}
			);
		}
		else
		{
			regions.each( function()
				{
					if ( mapdata[d3.select(this).attr('id')] && mapdata[d3.select(this).attr('id')].geography != 'water' )
						if( mapdata[d3.select(this).attr('id')].kingdom_id == part)
						{								
							d3.select(this).style("fill", mapdata[d3.select(this).attr('id')].kingdom_color);	
						}
						else
							d3.select(this).style("fill","#F9ECC9");	
				}
			);
		}
		break;
		
	case 'resources':
	
		// Resource colors
		console.log("-> Painting resources");
		var resourcecolor = [];
		resourcecolor['mine_iron'] = '#696969';
		resourcecolor['forest'] = '#006400';
		resourcecolor['breeding_cow_region'] = '#8b4513';
		resourcecolor['breeding_sheep_region'] = '#87ceeb';
		resourcecolor['breeding_pig_region'] = '#ffc0cb';
		resourcecolor['breeding_silkworm_region'] = '#800080';
		resourcecolor['breeding_bee_region'] = '#ffa500';
		resourcecolor['mine_gold'] = '#ffff00';
		resourcecolor['mine_stone'] = '#dcdcdc';
		resourcecolor['mine_clay'] = '#bdb76b';
		resourcecolor['saltern'] = '#6a5acd';
		resourcecolor['mine_coal'] = '#000000';
		resourcecolor['cave_white_sand'] = '#f4a460';		
		
		if (part == 'all')
		{
			;
		}
		else
		{
			regions.each(function()
				{					
					//console.log("mapdata: " + d3.select(this).attr('id'));
					//console.log("mapdata of: " + mapdata[d3.select(this).attr('id')]);
					
					if( mapdata[d3.select(this).attr('id')] && mapdata[d3.select(this).attr('id')].geography != 'water' )
					{	
						if ( 						
							$.type(mapresource[d3.select(this).attr('id')]) !== "undefined" 
							&& 
							mapresource[d3.select(this).attr('id')].structuretype == part 
							)
						{
							console.log("Coloring id: " + d3.select(this).attr('id') + " to " + 
								resourcecolor[mapresource[d3.select(this).attr('id')].structuretype]);							 
							d3.select(this).style("fill", resourcecolor[mapresource[d3.select(this).attr('id')].structuretype]);	
						}
						else
						{
							console.log("Coloring id: " + d3.select(this).attr('id') + " to Beige");
							d3.select(this).style("fill", '#F9ECC9');	
						}
					}
				}
			)
		}
		
	
		break;
				
	case 'clima':
	
		var clima = [];
		clima['hot'] = '#ff2200';
		clima['moderate'] = '#3CAD1D';
		clima['cold'] = '#6E79DE';
		
		regions.each(function()
			{						
				if( mapdata[d3.select(this).attr('id')] && mapdata[d3.select(this).attr('id')].geography != 'water')
				{							
					d3.select(this).style("fill", clima[mapdata[d3.select(this).attr('id')].clima]);				
				}
			}
		);			
		
		break;
		
	case 'geography':
		
		// Geo colors
		
		var geography = [];
		geography['mountains'] = '#715F2F';
		geography['hills'] = '#58774D';
		geography['plains'] = '#84AA79';
		
			
		regions.each(function()
			{						
				if( mapdata[d3.select(this).attr('id')] && mapdata[d3.select(this).attr('id')].geography != 'water')
				{							
					d3.select(this).style( "fill", geography[mapdata[d3.select(this).attr('id')].geography]);				
				}
			}
		);
		break;
	
	case 'diplomacy':
		
		// Diplomacy colors
		var diplo = [];
		diplo['hostile'] = 'Red';
		diplo['neutral'] = 'White';
		diplo['friendly'] = 'LightGreen';
		diplo['allied'] = 'Green';			
					
		regions.each(function()
			{
				
				// The region is configured and is not a sea region
				if( mapdata[d3.select(this).attr('id')] && mapdata[d3.select(this).attr('id')].geography != 'water')
					// The kingdom is not independent or equal to the select field
					if ( mapdata[d3.select(this).attr('id')].kingdom_id != part && mapdata[d3.select(this).attr('id')].kingdom_id != 37)					
					{
						
						relation = mapdiplo[part][mapdata[d3.select(this).attr('id')].kingdom_id].type;							
						d3.select(this).style("fill", diplo[relation]);				
					}
					else
						d3.select(this).style("fill", 'White');			
			}
		);			
		break;
}

};

